import React, { Component } from 'react';

class Gallery extends Component {
  render() {
    return (
      <div>
        <h2>Gallery</h2>
        <div>
          {
            this.props.items.map((item, index) => {
              let {title} = item.volumeInfo;
              return (
                <div key={index}>{title}</div>
              )
            })
          }
        </div>
      </div>
    )
  }
}

export default Gallery
